function checkButtonInsertion(){
  if(!document.getElementById('executeAiAssist') && document.getElementById('stow-study')){
    $('#executeAiAssist').remove();                              
    var b = $('<a>')
    .attr('id', 'executeAiAssist')
    .attr('data-role', 'button')
    .attr('href', '#')
    .attr('data-icon', 'forward')
    .attr('data-theme', 'a')
    .text('Execute AI Assist')
    .button()
    .click(function(e) {            
        const uuid = getQueryVariable("uuid")
        executeAiAssist(uuid)
    });
    $(document).keydown(function(event) {
        if (event.altKey && event.which === 88)
        {
            b.click()
            e.preventDefault();
        }
    });
    b.insertAfter($('#stow-study'));  
  }
}

function checkForAiEntries(){
  if(!isListChecked){
    const listSeries = document.getElementById("list-series")
    if(listSeries!== undefined){
      isListChecked = true;
      console.log(listSeries.children)
      for( element of listSeries.children) {
        if(element.classList.contains("ui-btn")){
          const attributesElement = element.children[0].children[0].children[0].children[0]
          console.log(attributesElement.children)
          let modality=undefined
          for(attribute of attributesElement.children){
            if(attribute.childNodes[0].textContent === "Modality: "){
              modality = attribute.childNodes[1].innerText
            }
          }
          if(modality!== undefined){
            if(modality==="CT"){
              const img = document.createElement("img")
              img.src = "data:image/png;base64,"+aiLogoBase64
              img.style = "height:1em; margin-right: 0.5em; padding-top: 0.1em;"
              img.alt = "Dieses Bild zeigt, dass es sich um ein CT-Set handelt"
              //attributesElement.children[0].prepend(img)
            }
            else if(modality==="SEG"){
              const img = document.createElement("img")
              img.src = "data:image/png;base64,"+aiLogoBase64
              img.style = "height:1em; margin-right: 0.5em; padding-top: 0.1em;"
              img.alt = "Dieses Bild zeigt, dass es sich um ein KI-generiertes Set handelt"
              attributesElement.children[0].prepend(img)
            }
            else if(modality==="SR"){
              const img = document.createElement("img")
              img.src = "data:image/png;base64,"+aiLogoBase64
              img.style = "height:1em; margin-right: 0.5em; padding-top: 0.1em;"
              img.alt = "Dieses Bild zeigt, dass es sich um ein KI-generiertes Dokument handelt"
              attributesElement.children[0].prepend(img)
            }
          }
        }
      }
    }
  }
  
}

$( document ).ready(function() {  
  setInterval(() => {
      checkButtonInsertion() 
      checkForAiEntries()                   
     
                                                 
                            
  }, 200) ;                           
  
});          
